package com.aspire.daydreaming.bundle.myActivity;import com.aspire.daydreaming.core.base.BaseModel;import com.aspire.daydreaming.core.base.BasePresenter;import com.aspire.daydreaming.core.base.BaseView;import com.aspire.daydreaming.core.model.info.ActivityInfo;import com.aspire.daydreaming.core.model.info.Data;import rx.Observable;/** * @Name: MyActivityContract * @Author: yeliang * @Date: 2016/8/24 */interface MyActivityContract {    interface View extends BaseView {        void onLoading(String msg);        void onComplete(Data<ActivityInfo> activityInfoData);        void onError(String errorMsg);    }    interface Model extends BaseModel {        Observable<Data<ActivityInfo>> getActivities();    }    abstract class Presenter extends BasePresenter<Model, View> {        public abstract void getActivities();        @Override        public void onStart() {        }    }}